import './App.css';
import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div className="nav-bar">
            <NavLink to="/">
                <h1>Home</h1>
            </NavLink>
            <NavLink to="/vocab">
                <h1>Vocabulary</h1>
            </NavLink>
            <NavLink to="/">
                <h1>COMING SOON</h1>
            </NavLink>
            <NavLink to="/">
                <h1>COMING SOON</h1>
            </NavLink>
        </div>
    );
}
export default Nav;
